import React, { Component } from "react";

import "../styles/Navbar.scss";

class Navbar extends Component {
    render() {
        return(
            <div>
                <nav id="navigation-menu" >
                    <ul>
                        <li>Brand name</li>
                        <li>one</li>
                        <li>two</li>
                        <li>three</li>
                    </ul>
                </nav>
            </div>
        )    
    }
}
